response.about:
За человека должны говорить ДЕЛА, поступки, а не СЛОВА.

В целом:
1. Люблю добрые старые сказки, не люблю брутальные истории;
2. Не люблю сопли;
3. Люблю,  к примеру, чай на природе;
4. Люблю когда дождь бьет дробью по жести холодных подоконников, а ты лежишь в тепле и тебе на это глубоко наплевать;
5. Не уважаю людей, которые врут, да они и сами себя не уважают, просто не укаждого из них хватает разума это понять;
6. «Всё, что вы делаете в постели - прекрасно и абсолютно правильно. Лишь бы это нравилось обоим. Если есть эта гармония - то вы и только вы правы, а все осуждающие вас - извращенцы» З. Фрейд.
7. Выигрывает тот, кто не оставляет сил на обратный путь.
8. Со второй половиной нужно стремиться постоянно работать, а не постоянно отдыхать -продуктивность удваивается вдвойне, вот тогда и отдых полноценен.
